import { Card, Table, Space, Divider } from 'antd'
import React, { Component } from 'react'
import UserHead from '../../../components/UserHead'
import LinkButton from '../../../components/LinkButton'

export default class TicketList extends Component {
    render() {


        const columns = [
            {
                title: '编号',
                dataIndex: 'carriageNumber',
                key: '1',
                align: 'center',
            },
            {
                title: '级别',
                dataIndex: 'level',
                key: '2',
                align: 'center',
            },
            {
                title: '规格',
                dataIndex: 'size',
                key: '3',
                align: 'center',
            },
            {
                title: '座位数',
                key: '4',
                dataIndex: 'seatNumber',
                align: 'center',
            },
            {
                title: '价格基数',
                key: '5',
                dataIndex: 'priceBase',
                align: 'center',
            },
            {
                title: '适配车型',
                key: '6',
                dataIndex: 'adapter',
                align: 'center',
            },
            {
                title: '操作',
                key: '7',
                render: () => (
                    <Space size="middle">
                        <LinkButton onClick={this.showUpdateModal}>编辑</LinkButton>
                    </Space>
                ),
                align: 'center'
            },
        ];

        const dataSource = [
            {
                key: '1',
                carriageNumber: '001',
                level: '豪华',
                size: '(4+4)*10',
                seatNumber: '20',
                priceBase: '8',
                adapter: '动车',
            },
        ]

        return (
            <div>
                <UserHead />
                <Divider />
                <div>
                    搜索
                </div>
                <Divider />
                <Card
                    bordered={false}
                >
                    <Table
                        columns={columns}
                        dataSource={dataSource}
                        bordered
                        rowKey="key"
                    />
                </Card>
            </div>
        )
    }
}
